{
  "Version": "2012-10-17",
  "Statement": [
    {
      "Sid": "Allow accounts access to the key",
      "Effect": "Allow",
      "Action": "kms:*",
      "Resource": "*",
      "Principal": {
        "AWS": "arn:aws:iam::862006574860:root"
      }
    },
    {
      "Sid": "Allow account members use of the key for encryption and decryption",
      "Effect": "Allow",
      "Action": [
        "kms:ReEncrypt*",
        "kms:GenerateDataKey*",
        "kms:Encrypt",
        "kms:DescribeKey",
        "kms:Decrypt",
        "kms:CreateGrant"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": "*"
      }
    },
    {
      "Sid": "Grant arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_AWSAdministratorAccess_e2199205f617c943 access to the key",
      "Effect": "Allow",
      "Action": [
        "Verify",
        "Sign",
        "ReEncryptTo",
        "ReEncryptFrom",
        "GenerateDataKeyWithoutPlaintext",
        "GenerateDataKey",
        "Encrypt",
        "DescribeKey",
        "Decrypt"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": "arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_AWSAdministratorAccess_e2199205f617c943"
      }
    },
    {
      "Sid": "Grant arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_AWSPowerUserAccess_4b1ceeabc799dd7f access to the key",
      "Effect": "Allow",
      "Action": [
        "Verify",
        "Sign",
        "ReEncryptTo",
        "ReEncryptFrom",
        "GenerateDataKeyWithoutPlaintext",
        "GenerateDataKey",
        "Encrypt",
        "DescribeKey",
        "Decrypt"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": "arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_AWSPowerUserAccess_4b1ceeabc799dd7f"
      }
    },
    {
      "Sid": "Grant arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_EngineeringAccess_4ccbe995d93ff747 access to the key",
      "Effect": "Allow",
      "Action": [
        "Verify",
        "Sign",
        "ReEncryptTo",
        "ReEncryptFrom",
        "GenerateDataKeyWithoutPlaintext",
        "GenerateDataKey",
        "Encrypt",
        "DescribeKey",
        "Decrypt"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": "arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_EngineeringAccess_4ccbe995d93ff747"
      }
    },
    {
      "Sid": "Grant arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_PowerUserAccess_82a6959f55a43a57 access to the key",
      "Effect": "Allow",
      "Action": [
        "Verify",
        "Sign",
        "ReEncryptTo",
        "ReEncryptFrom",
        "GenerateDataKeyWithoutPlaintext",
        "GenerateDataKey",
        "Encrypt",
        "DescribeKey",
        "Decrypt"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": "arn:aws:iam::862006574860:role/aws-reserved/sso.amazonaws.com/AWSReservedSSO_PowerUserAccess_82a6959f55a43a57"
      }
    },
    {
      "Sid": "Allow organization access to the key",
      "Effect": "Allow",
      "Action": [
        "kms:ReEncrypt*",
        "kms:GenerateDataKey*",
        "kms:Encrypt",
        "kms:DescribeKey",
        "kms:Decrypt",
        "kms:CreateGrant"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": "*"
      },
      "Condition": {
        "StringEquals": {
          "aws:PrincipalOrgID": "o-fdri2qhe6u"
        }
      }
    },
    {
      "Sid": "Allow CloudTrail to encrypt logs",
      "Effect": "Allow",
      "Action": "kms:GenerateDataKey*",
      "Resource": "*",
      "Principal": {
        "Service": "cloudtrail.amazonaws.com"
      },
      "Condition": {
        "StringLike": {
          "kms:EncryptionContext:aws:cloudtrail:arn": "arn:aws:cloudtrail:*:862006574860:trail/*"
        }
      }
    },
    {
      "Sid": "Allow CloudTrail to describe key",
      "Effect": "Allow",
      "Action": "kms:DescribeKey",
      "Resource": "*",
      "Principal": {
        "Service": "cloudtrail.amazonaws.com"
      }
    },
    {
      "Sid": "Allow CloudWatch logs to be used with this key",
      "Effect": "Allow",
      "Action": [
        "kms:ReEncrypt*",
        "kms:GenerateDataKey*",
        "kms:Encrypt*",
        "kms:Describe*",
        "kms:Decrypt*"
      ],
      "Resource": "*",
      "Principal": {
        "Service": "logs.us-east-1.amazonaws.com"
      }
    }
  ]
}
